import { Module, Subnet } from "../types";

export const loadGenesisData = async () => {
  const subnetRecords = Object.entries(subnets).map(([id, name]) =>
    Subnet.create({
      id,
      registeredAt: 0,
      timestamp: new Date(0),
      netUid: parseInt(id),
      extrinsicId: -1,
      name,
    })
  );
  const moduleRecords: Module[] = [];
  modules.forEach((subnets, index) => {
    const netUid = index;
    subnets.forEach((module, uid) => {
      const [key, name, address] = module as string[];
      moduleRecords.push(
        Module.create({
          id: `${netUid}-${uid}`,
          netUid,
          uid,
          name,
          address,
          timestamp: new Date(0),
          registeredAt: 0,
          key,
          extrinsicId: -1,
        })
      );
    });
  });

  await Promise.all([
    store.bulkCreate("Subnet", subnetRecords),
    store.bulkCreate("Module", moduleRecords),
  ]);
};

